	public static void assignEmbeddingsFromFile(ProteinChain chain, String filePath, EncodingType type) {
		final String splitPattern = "\\], \\[";
		
		String[] lines = getFileLines(filePath);
		String[] embeddings = lines[0].split(splitPattern);
		embeddings[0] = embeddings[0].replaceAll("\\[", "");
		embeddings[embeddings.length-1] = embeddings[embeddings.length-1].replaceAll("\\]", "");
		
		for(int index = 0; index < chain.size(); ++index) {
			String[] raw_values = embeddings[index].split(",");
			double[] values = new double[raw_values.length];
			for(int val = 0; val < raw_values.length; ++val) {
				values[val] = Double.parseDouble(raw_values[val]);
			}
			//qp(values);
			//System.exit(0);
			chain.get(index).setEncoding(type, values);
		}
	}
	
